import React, { useState } from 'react'
import CardsData from "./Json/CardsData.json"

export default function Cards() {

  const [Buttondata , setButtondata] = useState(CardsData.ButtonTitle)
  const [CardData , setCardData] = useState(CardsData.Card)
  console.log(CardData);

  return (
    <div className='Cards'>
      <div className="Cards_row">
        <div className="Cards_row_col">
          {
            Buttondata.map((value , key)=>(
              <button key={key}>{value.title}</button>
            ))
          }
        </div>
        <div className="Cards_row_col">
          <div className="Cards_row_col_search">
            <input type="text" name="text" id="text" />
          </div>

        </div>

      </div>
      <div className="Cards_cards">
        
      </div>
    </div>
  )
}
